import logo from './logo.svg';
import './App.css';
import { Container, Input } from 'semantic-ui-react';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Container>
          <Input placeholder="First Name" />
          <Input placeholder="Last Name" />
          <Input placeholder="E-mail" />
        </Container>
      </header>
    </div>
  );
}

export default App;
